const HOME = 'HOME';

const initialState = {
  socImages: [
    { facebook: '' },
    { src: 'https://www.instagram.com/static/images/ico/favicon-200.png/ab6eff595bb1.png', alt: 'instagram' },
    { alt: 'github', src: 'https://upload.wikimedia.org/wikipedia/commons/thumb/9/91/Octicons-mark-github.svg/1200px-Octicons-mark-github.svg.png' },
    { alt: 'gmail' },
    { youtube: 'youtube' },

  ]
}

export default function HomeReducer(state = initialState, action) {

  switch (action.type) {
    default:

      return state;
  }
}
